import React from "react";
import "./style.css";
import { Link } from "react-router-dom";

const Header = () => {
  return (
    <header>
      <div className="header_left">
        <Link to="/" className="header_logo"></Link>
      </div>
      <div className="header_middle"></div>
      <div className="header_right"></div>
    </header>
  );
};

export default Header;
